import React from 'react'
import s from './Banner.module.css'

export default function GreenHomeBanner() {
  return (
    <div className={s.green_banner}>
            <h2>5% off</h2>
            <h3>On the first order</h3>
            <input type='phone' className={s.phone_input} placeholder='+49'/>
            <button className={s.phone_button}>Get a discount</button>
    </div>
  )
}
